import Note from "./Note"



const Project = props => {
    const notes = props.notes;
    return (
    <div class="nav-item">
            <h1>{props.project}</h1>
            <div>{
                Object.keys(notes).map((note,i) =>
                    <Note key={i} type={notes[note].type} text={notes[note].text} title={notes[note].title} url={notes[note].url}/>
                )
            }
            </div>
    </div>)
}




export default Project;
